  const [startDate, setStartDate] = useState(null);
  const [endDate, setEndDate] = useState(null);



  return (
    <div>
      <h1>Exam Details</h1>
      <div>
        <label>Exam Name:</label>
        <input
          type="text"
          value={examName}
          onChange={(e) => setExamName(e.target.value)}
        />
      </div>
      <div>
        <label>Start Date:</label>
      </div>
